Alors que l'économie numérique continue d'accélérer à un rythme sans précédent, PayPal soutient l'économie numérique en permettant aux gens de déplacer de l'argent à travers le monde sans friction. En tant qu'expert en paiements numériques chez PayPal, vous utiliserez vos compétences et vos connaissances pour servir des millions d'utilisateurs de PayPal dans le monde entier afin d'envoyer et de recevoir de l'argent en toute sécurité, quel que soit leur lieu de résidence.

À propos du poste :
• Dans ce poste de consultant en analyse des risques, vous rejoindrez une équipe diversifiée et dynamique travaillant sur la stratégie mondiale de risque de crédit de PayPal ;
• L'accent principal est mis sur la compréhension du comportement des payeurs afin que PayPal puisse identifier les transactions frauduleuses potentielles et les empêcher de se produire en premier lieu. En tant que tel, vous occuperez également divers rôles techniques tels que l'ingénierie des données ou l'ingénierie de l'apprentissage automatique dans le cadre du travail ;
